import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="http://softubon.co.th/assets/coming-soon.jpeg" className="App-logo" alt="logo" />
        <p>
        หจก.ซอฟต์อุบล
        </p>
        <img src="http://softubon.co.th/assets/logo-amazon-web-services-partner-network.png" alt="Powered by AWS Cloud Computing" width="120px;"/>
            <a href="https://lin.ee/lW4BTft"><img src="https://scdn.line-apps.com/n/line_add_friends/btn/th.png" alt="เพิ่มเพื่อน" height="36" border="0"/></a>
      </header>
    </div>
  );
}

export default App;
